import { Card, Avatar, Button, Col, Row } from "antd";
import CenteralAppLayout from "./CenteralAppLayout";
// import { CalendarOutlined } from "@ant-design/icon";

const ProfileCard = () => {
  const dummy = {
    pet: {
      name: "wilson",
      breed: "골든 리트리버",
      birth: new Date().toLocaleDateString(),
      address: "경기도 성남시 분당구",
      image: "http://www.animaltogether.com/news/photo/201907/167_346_855.jpg",
    },
    owner: { name: "kk" },
  };
  return (
    <CenteralAppLayout>
      <Card title={dummy.pet.name} actions={[]} cover={<img src={dummy.pet.image} />}>
        <Card.Meta
          avatar={<Avatar src={dummy.pet.image} />}
          title={dummy.pet.name}
          description={
            <Row gutter={12}>
              <Col xs={12}>견종</Col>
              <Col xs={12}>{dummy.pet.breed}</Col>
              <Col xs={12}>생일</Col>
              <Col xs={12}>{dummy.pet.birth}</Col>
              <Col xs={12}>주소</Col>
              <Col xs={12}>{dummy.pet.address}</Col>
            </Row>
          }
        />
      </Card>
    </CenteralAppLayout>
  );
};

export default ProfileCard;
